import { Link } from "react-router-dom";
import "../stylesheets/Front.scss";

const Front = () => {
  return (
    <div className="front">
      <Link to="/" className="link">
        <span className="">landing</span>
      </Link>
      <Link to="/UX/" className="link">
        <span className="">Ux</span>
      </Link>
    </div>
  );
};

export default Front;
